column8:
1.3段階スチームで潤いのある艶髪に<br>
2.マイナスイオンが髪のパサつきを優しくコート<br>
3.ナノセラミックコーティングプレートが髪へのダメージを軽減<br>
4.120～200℃のLED温度表示<br>
5.くしの高さを調整する3段階調整コーム<br>
6.コードのねじれを防止する360度回転スイブルコード<br>
7.閉じた状態でコンパクトにロックするプレートロック<br><br><br>
◇製品仕様◇<br>
□電源：100V　50/60Hz<br>
□消費電力：65W<br>
□温度調整：5段階　約120℃～最大200℃<br>
□コード長さ：2.75ｍ<br>
□本体サイズ：約282mm（コード含まず）<br>
□プレート幅：35mm<br>
□質量：500g<br>
